import React, { FormEvent, useState } from 'react'

function UserLogin(props: any) {
    // username: string, setUsername: any, password: string, setPassword: any, handleSubmit: any
  return (
    <form onSubmit={props.handleSubmit}>
        <label>Username:
            <input type='text' value={props.username} onChange={(e:any) => props.setUsername(e.target.value)}/>
        </label><br/>

        <label>Password:
            <input type='password' value={props.password} onChange={(e:any) => props.setPassword(e.target.value)}/>
        </label><br/>

        <button type='submit'>Submit</button>
    </form>
  )
}

export default UserLogin
